import axios from '../Axios/Axios';
import { Container } from 'react-bootstrap';

export const Flight = () => {
    const[flight,setFlight]=useState();
    useEffect(()=>
    {
        axios.post("/admin/flight").then(async(result)=>
        {
            await setFlight(result.data.result);
            console.log(flight)
        }).catch((err)=>console.log(err));
    },[])
  return (
    <Container>

